def nested_loops_and_indexing(my_list):
    """
    In this exercise, you will need to write a program that uses nested loops to find the first occurrence of a specific value in a 2D array. The 2D array is represented by a list of lists, where each inner list represents a row of the array. The value you are looking for is the first element of the first inner list.
